Cannot populate Mongoose schema from req.body<p>I'm working with a complex data structure in MongoDB and using <code>mongoose</code> to handle the server-to-database communication.</p>
<p>In <code>mongoose</code> I have a schema defined like this:</p>
<pre><code>var mongoose = require('mongoose')
var Schema = mongoose.Schema;

const timePeriodSchema = new mongoose.Schema({
    opensAt: {type: String, default: null},
    closesAt: {type: String, default: null}
});

const daySchema = new mongoose.Schema({
    closed: {type: Boolean, default: false},
    hours: [timePeriodSchema]
});

const weekSchema = new mongoose.Schema({
    monday: daySchema,
    tuesday: daySchema,
    wednesday: daySchema,
    thursday: daySchema,
    friday: daySchema,
    saturday: daySchema,
    sunday: daySchema,
});

const restaurantSchema = new mongoose.Schema({
    userId: {
        type: mongoose.Schema.Types.ObjectId,
        required: false,
        ref: 'User',
        default: null
    },
    name: {
        type: String,
        required: true,
        default: null
    },
    category: [String],
    type: [String],
    style: [String],
    cuisine: [String],
    customDescription: {
        type: String,
        required: false,
        default: null
    },
    address: {
        type: String,
        required: true,
        default: null
    },
    countryCode: {
        type: String,
        required: true,
        default: null
    },
    services: [String],
    photos: [Buffer],
    openingHours: weekSchema,
    phonePrefix: {
        type: String,
        required: true,
        default: null
    },
    phoneNumber: {
        type: String,
        required: true,
        default: null
    },
    website: {
        type: String,
        required: false,
        default: null
    },
    reservationMethods: [String],
    paymentMethods: [String],
    createdAt: {
        type: Date,
        required: true,
        default: Date.now,
    }
});

module.exports = mongoose.model('Restaurant', restaurantSchema)
</code></pre>
<p>And I try to create a new Restaurant with the following code:</p>
<pre><code>saveRestaurant: function(req, res){
        Restaurant.findOne({
            address: req.body.address
        }, function(err, restaurant){
            if(err) throw err;
            if(restaurant){
                return res.status(500).send({success: false, key: 'addressUsed', title: res.__('requestFailedTitle'), msg: res.__('restaurantSaveAlreadyExistsErrorMsg')});
            }else{
                User.findOne({
                    email: req.body.userEmail
                }, function (err, user){
                    if(err){
                        throw err
                    }
                    if(user){
                        var restaurant = new Restaurant(req.body);
                        restaurant.userId = user._id;
                        restaurant.save(function(err, restaurant){
                            if(err) throw err;
                        });
                        return res.status(200).send({success: true, msg: res.__('saveSuccessResponse')});
                    }
                });
            }
        });
    }
</code></pre>
<p>And here is a sample of the <code>req.body</code> that the server receives:</p>
<pre><code>{
  &quot;userEmail&quot;: &quot;example@gmail.com&quot;,
  &quot;name&quot;: &quot;My Restaurant&quot;,
  &quot;category&quot;: [ &quot;Café&quot;, &quot;Pub&quot; ],
  &quot;type&quot;: [ &quot;Ethnic Restaurant&quot;, &quot;Fine Dining Restaurant&quot; ],
  &quot;style&quot;: [ &quot;Elegant&quot; ],
  &quot;cuisine&quot;: [ &quot;Haute&quot; ],
  &quot;customDescription&quot;: &quot;This is a custom description&quot;,
  &quot;address&quot;: &quot;Piazza di Spagna, Piazza di Spagna, Rome, Metropolitan City of Rome, Italy&quot;,   
  &quot;countryCode&quot;: &quot;IT&quot;,
  &quot;services&quot;: [ &quot;Handicap&quot;, &quot;Restroom&quot; ],
  &quot;photos&quot;: [],
  &quot;openingHours&quot;: {
    &quot;Monday&quot;: { &quot;closed&quot;: true, &quot;hours&quot;: [
        {&quot;opensAt&quot;: &quot;11:00&quot;, &quot;closesAt&quot;: &quot;17:00&quot;}
    ]},
    &quot;Tuesday&quot;: { &quot;closed&quot;: true, &quot;hours&quot;: [
        {&quot;opensAt&quot;: &quot;11:00&quot;, &quot;closesAt&quot;: &quot;17:00&quot;}
    ]},
    &quot;Wednesday&quot;: { &quot;closed&quot;: true, &quot;hours&quot;: [
        {&quot;opensAt&quot;: &quot;11:00&quot;, &quot;closesAt&quot;: &quot;17:00&quot;}
    ]},
    &quot;Thursday&quot;: { &quot;closed&quot;: true, &quot;hours&quot;: [
        {&quot;opensAt&quot;: &quot;11:00&quot;, &quot;closesAt&quot;: &quot;17:00&quot;}
    ]},
    &quot;Friday&quot;: { &quot;closed&quot;: true, &quot;hours&quot;: [
        {&quot;opensAt&quot;: &quot;11:00&quot;, &quot;closesAt&quot;: &quot;17:00&quot;}
    ]},
    &quot;Saturday&quot;: { &quot;closed&quot;: true, &quot;hours&quot;: [
