}
</code></pre>
<p>The problem is that the restaurant created has all the fields set perfectly, except for the nested openingHours field.</p>
<p>In the <code>openingHours</code> field only the <code>_id</code> of an object is stored and nothing else.</p>
<p>It seems that <code>mongoose</code> is not able to retrieve and populate the nested schemas.</p>
<p>However I have read that apparently it should be able to. Anyone have any idea of what I am doing wrong?</p>
<p>I don't want to use separate collections and link them via <code>_id</code> as it would result in too many useless collections; I would like to have everything in the same collection.</p>
