stop searching after find first element<p>The answer might be very easy but i cannot find it:</p>
<p>I have this pipeline</p>
<pre><code>  return (await Blog.aggregate([
    { $limit: 1 },
    { $match: { _id } },
    {
      $lookup: {
        from: User.collection.name,
        localField: &quot;author&quot;,
        foreignField: &quot;_id&quot;,
        as: &quot;author&quot;
      }
    },
    {
      $unwind: &quot;$author&quot;
    },
    {
      $set: {
        author: &quot;$author.author&quot;
      }
    },
    {
      $project: {
        ips: 0
      }
    }
  ]).exec())[0]
</code></pre>
<p>I have added <code>$limit</code> to 1 because i was thinking that it will stop searching for elements after finding 1. But instead the search is limited to only 1 element.</p>
<p>That means if there are 10 elements only the first will be scanned because of <code>$limit</code> 1.</p>
<p>How can i optimize this pipeline ?</p>

