How to use Forest Admin properly with nodeJs server? (with forest-express-mongoose)<p>I'm trying to run a server programmed in NodeJS locally on my laptop and interact with Forest Admin using the forest-express-mongoose package. The DB is a local MongoDB.</p>
<p>So I run my server and it is able to connect with an app I made perfectly. It connects to the mongoDB database properly as well.
So then I want to use Forest Admin.
I'm not so familiarized with Forest but I think I don't have to install Forest admin as an npm project cause that would create another separated project and in this case I'm using forest-express-mongoose from inside my server.
Now what I don't know is how to get the Forest admin panel?</p>
<p>My server runs but it gives me an error because the env key is not associated with any forest panel: (Forest server request error: Not Found)</p>
<p>That is indeed to be expected since I have to create a project from inside the Forest website. But then when I want to create one, the installation process wants me to create and install another separated server. That is not what I want, I want to integrate it with my existing server. How can I achieve this?</p>
<p>Here's my server's code:</p>
