require('./app/routes/user.routes.js')(app);
require('./app/routes/volunteer.routes.js')(app);
require('./app/routes/donation.routes.js')(app);

// listen for requests
app.listen(process.env.PORT || 3000, () =&gt; {
    console.log(&quot;Server is listening on port 3000&quot;);
});

app.use(require('forest-express-mongoose').init({
    modelsDir: __dirname + '/app/models',
    envSecret: 'xxx', // the key I obviously don't have
    authSecret: 'testeando', // I think I can put any string for development purposes, otherwise I don't know were to get authSecret
    mongoose: require('mongoose'),
}));
</code></pre>
<p>My package.json has the following dependencies:</p>
<pre><code>&quot;dependencies&quot;: {
  &quot;async&quot;: &quot;^2.6.2&quot;,
  &quot;body-parser&quot;: &quot;^1.18.3&quot;,
  &quot;cors&quot;: &quot;^2.8.5&quot;,
  &quot;dotenv&quot;: &quot;^6.2.0&quot;,
  &quot;express&quot;: &quot;^4.16.4&quot;,
  &quot;forest-express-mongoose&quot;: &quot;^2.16.1&quot;,
  &quot;mongodb&quot;: &quot;^3.1.13&quot;,
  &quot;mongoose&quot;: &quot;5.1.4&quot;,
  &quot;mongoose-schema-extend&quot;: &quot;^0.2.2&quot;
}
</code></pre>
<p>I'm aware I'm using some old dependencies but if I start changing them, the project starts having issues.</p>
<p>So I'm sort of in a vicious cycle here. I need the Forest admin created to make my server work but the Forest admin creation process wants me to create a separated server.</p>
<p>Or maybe I also need to run a Forest server? I tried that and turns out if I run forest first it gets data from my DB but then when I run my server it changes its models and it gives me an error &quot;The server encountered an error&quot;.</p>

