Mongoose: the isAsync option for custom validators is deprecated<p>The <a href="https://github.com/stripe/stripe-connect-rocketrides/blob/master/server/models/pilot.js" rel="nofollow noreferrer">Stripe Rocket Rides demo</a> uses <code>isAsync</code> in a validator:</p>
<pre class="lang-js prettyprint-override"><code>// Make sure the email has not been used.
PilotSchema.path('email').validate({
  isAsync: true,
  validator: function(email, callback) {
    const Pilot = mongoose.model('Pilot');
    // Check only when it is a new pilot or when the email has been modified.
    if (this.isNew || this.isModified('email')) {
      Pilot.find({ email: email }).exec(function(err, pilots) {
        callback(!err &amp;&amp; pilots.length === 0);
      });
    } else {
      callback(true);
    }
  },
  message: 'This email already exists. Please try to log in instead.',
});
</code></pre>
<p>This method throws an error with a reference</p>
<pre>
DeprecationWarning: Mongoose: the `isAsync` option for custom validators is deprecated. Make your async validators return a promise instead: https://mongoosejs.com/docs/validation.html#async-custom-validators
</pre>
<p>The MongoDB page quoted has this code:</p>
<pre class="lang-js prettyprint-override"><code>const userSchema = new Schema({
  name: {
    type: String,
    // You can also make a validator async by returning a promise.
    validate: () =&gt; Promise.reject(new Error('Oops!'))
  },
  email: {
    type: String,
    // There are two ways for an promise-based async validator to fail:
    // 1) If the promise rejects, Mongoose assumes the validator failed with the given error.
    // 2) If the promise resolves to `false`, Mongoose assumes the validator failed and creates an error with the given `message`.
    validate: {
      validator: () =&gt; Promise.resolve(false),
      message: 'Email validation failed'
    }
  }
});
</code></pre>
<p>I am new to NodeJS and I don't see how to adapt the MongoDB code to the Rocket Rides demo. Neither <a href="https://stackoverflow.com/questions/42877930/implicit-async-custom-validators-custom-validators-that-take-2-arguments-are-d">Implicit async custom validators (custom validators that take 2 arguments) are deprecated in mongoose &gt;= 4.9.0</a> nor <a href="https://stackoverflow.com/questions/51766754/mongoose-custom-validation-for-password">Mongoose custom validation for password</a> helped.</p>
<p>How can I verify the uniqueness of email addresses and avoid that error?</p>

