Decode in BSON, an interface which is implemented by a private structure<p>I am trying to do a basic TODO list application in Go. I am creating the CRUD operations on my cluster from mongodb atlas. But I have a problem decoding BSON objects. For my model I use a struct which is unimported but it implements a interface which is used in the repo. When trying to read from database I get this error:</p>
<blockquote>
<p>panic: no decoder found for interfaces.IToDoItem</p>
</blockquote>
<p>I know I should somehow implement a decoder for my interface but can not realize how to do it, without exporting my main struct from model. That would also mean I won't have a privacy in the model and the items in the model can be accessed in any mode all around the program, a thing which I think is wrong.</p>
<p>Here is my code:</p>
<p>model.go</p>
<pre><code>type toDoItem struct{
    ItemId      int             `bson:&quot;itemId,omitempty&quot;`
    Title       string          `bson:&quot;title,omitempty&quot;`
    Description string          `bson:&quot;description,omitempty&quot;`
}

func New(itemId int,title string,description string) interfaces.IToDoItem {
    return toDoItem{
        ItemId:      itemId,
        Title:       title,
        Description: description,
    }
}

func (item toDoItem)GetItemId()int{
    return item.ItemId
}

func (item toDoItem)GetTitle()string{
    return item.Title
}

func (item toDoItem)GetDescription()string{
    return item.Description
}
</code></pre>
<p>Interface</p>
<pre><code>type IToDoItem interface {
    GetItemId() int
    GetTitle() string
    GetDescription() string
}
</code></pre>
<p>repo function</p>
<pre><code>func (r *Repository)GetAll() []interfaces.IToDoItem{
    cursor, err := r.collection.Find(context.TODO(), bson.D{})
    if err != nil{
        panic(err)
    }
    defer cursor.Close(context.Background())

    var allItems []interfaces.IToDoItem

    for cursor.Next(context.Background()){
        var result interfaces.IToDoItem
        err := cursor.Decode(&amp;result)
        if err!= nil{
            panic(err)
        }
        allItems = append(allItems[:],result)
    }
    fmt.Println(allItems)
    return []interfaces.IToDoItem{}
}
</code></pre>
<p>For now it does not return anything because I want to resolve the issues at the repo level.</p>

