How do I use values from external server in app.post function<p>I'm finishing my simple app that allows to register user and then login to the shop. The registration part is finished and I already can put new collections and documents into the external mongoDB cluster.</p>
<p>I got stuck at the login part. Let me show you the code.</p>
<p>Here is the function that checks my mongoDB collection if particular user exists. If exists it sets <strong>userExists</strong> to True. <strong>It is global variable</strong>. I guess it's not good, but I couldn't do it placing that variable inside function. Also I want to point out that this finding function works well and it really returns true or false depending if user exists or not.</p>
<pre><code>async function checkUser(userData) {
    await dbConnect();
    await _db.db('blackmarket').collection('users').find().toArray(async (err, content) =&gt; {

        const foundUser = await content.find(singleuser =&gt; singleuser.login === userData.login &amp;&amp; singleuser.password === userData.password)

        if (foundUser) {
            usersExists = await true
            console.log(userExists); // if exists it will display true in console, but later than the same value from *app.post('/login')*

        } else if (!foundUser) {
            usersExists = await false;
            console.log(userExists);
        }
    })
}
